import React, { Component } from "react";

class AdminTools extends Component {
    constructor(props) {
          super(props);
//        this.loadCounts = this.loadCounts.bind(this);
    }

    updateGoogleSheet() {

        alert("Counts logged to your Google Spreadsheet!")

    }

    render() {
          return (
                <>
                    <br></br>
                    <h5> Admin Tools </h5>
                    <button
                        type="button"
                        className="btn btn-primary sideBarButton"
                        onClick={updateGoogleSheet}
                    >
                            Log Weekly Spreadsheet
                    </button>
                </>
          );
    }
}


export default AdminTools;
